# Título: Capacitação em PyPDF2 

## Descrição:
Acreditamos que a biblioteca PyPDF2 será de grande importância no desenvolvimento do projeto, ajudando na extração de dados dos PDF's dos diários oficiais. Dessa forma, alguns membros deverão se capacitar nela e compartilhar seus aprendizados.

## Tarefas Propostas:

- [x] **Estudo teórico da biblioteca** - entender o funcionamento da biblioteca, além de analisar se o uso dela é viável para a o projeto;
- [x] **Tentativa de implementação** - fazer o teste com algum PDF para aprender a biblioteca de forma prática;
- [x] **Elaboração de material para estudo e revisão dos membros**;

## Critérios de Aceitação:

- Material sobre a biblioteca PyPDF2;
- Treinamento para os outros membros.

## Responsáveis:
@BiancaPatrocinio7 @matheusbmello 

## Data Limite:
25/09/2023

# Título: Elaboração do Protótipo de Baixa Fidelidade

## Descrição:
Nesta issue, estamos rastreando o desenvolvimento do protótipo de baixa fidelidade para o projeto. O protótipo de baixa fidelidade é uma representação inicial do design e da funcionalidade do projeto, que nos ajudará a visualizar e iterar sobre as ideias antes de avançar para o protótipo de alta fidelidade.

## Tarefas Propostas:

- [x] Definir os principais elementos, recursos e fluxos a serem incluídos no protótipo;
- [x] Criar esboços de baixa fidelidade ou wireframes para cada tela ou fluxo;
- [x] Montar o protótipo usando ferramentas adequadas (por exemplo, Figma, Sketch, papel e lápis, etc);
- [x] Coletar feedback do restante da equipe;
- [x] Fazer alterações caso preciso após os feedbacks da equipe.

## Critérios de Aceitação:

- Os principais recursos e fluxos estão representados no protótipo;
- Esboços de baixa fidelidade finalizados;
- Iterações realizadas após os feedbacks;

## Responsáveis:
@anabborges @cqcoding @VieiraLaris @vitorfleonardo 

## Data Limite:
25/09/2023

# Título: Levantamento de Requisitos do Projeto

## Descrição:
Para garantir o sucesso do nosso projeto, é crucial realizar um levantamento abrangente de requisitos. Esta issue tem como objetivo iniciar o processo de coleta e documentação de requisitos do projeto para que possamos compreender completamente as necessidades e expectativas dos stakeholders.

## Tarefas propostas:

- [x] **Entender de forma objetiva** com a professora, assim como com o auxílio do site da Open Knowledge Brasil a proposta do projeto;
- [x] **Identificar os stakeholders do projeto**: Identificar todos os stakeholders envolvidos no projeto, incluindo equipes internas, clientes, usuários finais e outros interessados;
- [x] **Documentação de Requisitos**: Documentar claramente os requisitos funcionais e não funcionais do projeto com base nas informações coletadas;
- [x] **Priorização de Requisitos**: Priorizar os requisitos com base em sua importância e impacto no sucesso do projeto;
- [x] **Validação** com os outros membros da equipe e, se possível, com a professora.

## Critérios de Aceitação:

- Documento com os Requisitos Funcionais e Não Funcionais do projeto de forma compreensível e não ambígua;

## Responsáveis:
@anabborges 
@BiancaPatrocinio7 
@bdebatata 
@vitorfleonardo 

## Data Limite:
18/09/2023

# Título: Documentação da Arquitetura do Projeto

## Descrição: 
Nossa equipe reconhece a importância de manter uma documentação clara e detalhada da arquitetura do projeto para facilitar o desenvolvimento, a colaboração e a manutenção futura. Esta issue tem como objetivo iniciar o processo de criação e atualização da documentação da arquitetura do projeto.

## Tarefas propostas:

- [x] **Mapeamento da Arquitetura:** Documentar a arquitetura do projeto de forma clara e concisa, incluindo informações sobre componentes, fluxos de dados, tecnologias utilizadas e dependências.

## Critérios de Aceitação:

- Documentação pronta de fácil compreensão;
- Documentação aprovada pelos membros;

## Responsáveis:
@bdebatata 
@BiancaPatrocinio7 

## Data Limite:
09/10/2023
